        private Dictionary<ulong, List<AperyBookEntry>> bookCollection;

        public AperyBook()
        {
            this.bookCollection = new Dictionary<ulong, List<AperyBookEntry>>();
        }

        /// <summary>
        /// 追加
        /// </summary>
        public void Add(ulong key, ushort formToPro, int count)
        {
            AperyBookEntry entry = new AperyBookEntry(key, formToPro, count);

            if (!this.bookCollection.ContainsKey(key))
            {
                // ない場合
                this.bookCollection.Add(key, new List<AperyBookEntry>());
            }

            this.bookCollection[key].Add(entry);
        }

