            using (FileStream fs = new FileStream(filename, FileMode.Create, FileAccess.Write))
            {
                foreach (KeyValuePair<ulong, List<AperyBookEntry>> kvp in this.bookCollection)
                {
                    kvp.Value.Sort((a, b) => ((int)a.Count - (int)b.Count));

                    foreach (AperyBookEntry entry in kvp.Value)
                    {
                        fs.Write(entry.GetBytes(), 0, 16);
                    }
                }
            }
        }
    }

    /// <summary>
    /// Book Entry
    /// </summary>
    public class AperyBookEntry
    {
        public ulong Key;
        public ushort FromToPro;
        public ushort Count;
        public int Score;

        public AperyBookEntry(ulong key, ushort fromToPro, int count)
        {
            this.Key = key;
            this.FromToPro = fromToPro;

            this.Count = (count > ushort.MaxValue) ? ushort.MaxValue : (ushort)count;
        }

        /// <summary>
        /// バイナリ取得
        /// </summary>
        /// <returns></returns>
        public byte[] GetBytes()
        {
            byte[] bin = new byte[16];

            Array.Copy(BitConverter.GetBytes(this.Key), 0, bin, 0, 8);
            Array.Copy(BitConverter.GetBytes(this.FromToPro), 0, bin, 8, 2);
            Array.Copy(BitConverter.GetBytes(this.Count), 0, bin, 10, 2);
            Array.Copy(BitConverter.GetBytes(this.Score), 0, bin, 12, 4);

            return bin;
        }
    }

    public enum AperyPieceType
    {
        // Pro* は 元の 駒の種類に 8 を加算したもの。
        PTPromote = 8,
        Occupied = 0, // 各 PieceType の or をとったもの。
        Pawn, Lance, Knight, Silver, Bishop, Rook, Gold, King,
        ProPawn, ProLance, ProKnight, ProSilver, Horse, Dragon,
        PieceTypeNum,

        GoldHorseDragon // 単にtemnplate引数として使用
    }

    public enum AperyPiece
    {
        // B* に 16 を加算することで、W* を表す。
        // Promoted を加算することで、成りを表す。
        Empty = 0, UnPromoted = 0, Promoted = 8,
        BPawn = 1, BLance, BKnight, BSilver, BBishop, BRook, BGold, BKing,
        BProPawn, BProLance, BProKnight, BProSilver, BHorse, BDragon, // BDragon = 14
        WPawn = 17, WLance, WKnight, WSilver, WBishop, WRook, WGold, WKing,
        WProPawn, WProLance, WProKnight, WProSilver, WHorse, WDragon,
        PieceNone // PieceNone = 31  これを 32 にした方が多重配列のときに有利か。
    }

